import CatalagoCarCard from "components/CatalogoCardCar";

function Catalogo() {

    return (
        <div className='container'>
            <div className='d-flex mt-3 base-card input-container'>
                <input type='text' placeholder='Digite sua busca' className='form-control'/>
                <button className='btn btn-primary'>BUSCAR</button>
            </div>
            <div className='row justify-content-between'>
                <div className='col-sm-6 col-md-6 col-lg-4 col-xl-3 of 3 '><CatalagoCarCard /></div>
                <div className='col-sm-6 col-md-6 col-lg-4 col-xl-3'><CatalagoCarCard /></div>
                <div className='col-sm-6 col-md-6 col-lg-4 col-xl-3'><CatalagoCarCard /></div>
                <div className='col-sm-6 col-md-6 col-lg-4 col-xl-3'><CatalagoCarCard /></div>
                <div className='col-sm-6 col-md-6 col-lg-4 col-xl-3'><CatalagoCarCard /></div>
                <div className='col-sm-6 col-md-6 col-lg-4 col-xl-3'><CatalagoCarCard /></div>
                <div className='col-sm-6 col-md-6 col-lg-4 col-xl-3'><CatalagoCarCard /></div>
                <div className='col-sm-6 col-md-6 col-lg-4 col-xl-3'><CatalagoCarCard /></div>
            </div>
        </div>
    );
}

export default Catalogo;
